import { Link } from "react-router-dom";
import styles from './Na'
export default function Navbar() {
  return (
    <nav className = {styles.navbar}>
       <ul>
        <li className = {style.title}>
            Finance App
        </li>
        <li> <Link to ="/Login">Login</Link></li>
        <li> <Link to ="/Signup">Signup</Link></li>
       </ul>
    </nav>
  )
}
